import React from "react"; 
import IndividualProjects from "./individualProjects";
import GroupProjects from "./groupProjects";
import { Container, Tabs, Tab } from "react-bootstrap";

import "./projects.css";

const Projects = () => {
    return (
    <Container className = "projectsTabsContainer">
        <Tabs defaultActiveKey="projects" id="projects" title="Projects">

        <Tab eventKey="projects" title="X">
    </Tab>

        <Tab eventKey="IndividualProjects" title="Individual Projects">            
            <IndividualProjects></IndividualProjects>
        </Tab>

        <Tab eventKey="GroupProjects" title="Group Projects" href = "/groupProjects">          <GroupProjects></GroupProjects>
        </Tab>
        </Tabs>

    </Container>      

    )
}

export default Projects;
